  \"protection-island-nwr-initial-survey-instructions-for-purple-martin-breeding-bird-survey\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"During the 2013 breeding season, several
  Purple Martins were observed entering cavities in snags located on or adjacent to
  the grasslands on PINWR. In 2014, Purple Martins were not observed during the breeding
  season, but several were observed entering cavities much later in the breeding season.
  This species is listed as a Species of Concern by the State and is the focus of
  a massive citizen science restoration project designed to provide artificial nesting
  structures throughout the range of the species including this Refuge. It is unknown
  whether the individuals observed entering snags were prospecting or supporting active
  nests. If actively nesting, then this could represent one of only two known incidences
  of martins nesting in natural cavities in the state.  Surveys are planned in 2015
  to assess nesting status of this species. If nesting status is confirmed, we will
  continue with annual monitoring.  This data will guide habitat restoration efforts
  to avoid disturbance to potential nesting structures.This survey was identified
  as a Tier 2 priority because it will inform an expected management action and there
  is some immediacy of need, but it does not directly meet the refuge purpose nor
  is it necessary to fulfill a legal requirement.  In addition, Purple Martins are
  identified as candidate species under the WA State ESA.\",\n\t\"license_title\":
